import IndexPage from "../pages/IndexPage";
import LoginPage from "../pages/LoginPage";
import LogoutPage from "../pages/LogoutPage";

export const nav = [
  {
    path: "/",
    name: "Home",
    element: <IndexPage />,
    isMenu: true,
    isPrivate: false,
  },
  {
    path: "/login",
    name: "Login",
    element: <LoginPage />,
    isMenu: false,
    isPrivate: false,
  },
  {
    path: "/logout",
    name: "Logout",
    element: <LogoutPage />,
    isMenu: false,
    isPrivate: true,
  },
  {
    path: "/my_profile",
    name: "My Profile",
    element: <IndexPage />,
    isMenu: true,
    isPrivate: true,
  },
];
